import React, { useEffect, useState } from 'react'

function ApiEx() {
    const [records, setRecords] = useState([])

    useEffect(()=>{
        fetch('https://en.wikipedia.org/w/api.php?action=opensearch&search=Harry+Potter&format=json&origin=*').then(response => response.json()).then(data =>setRecords(data)).catch(err => console.log(err))
    },[])


  return (
    <div>
        <ul>
            {records.map((list, index)=>(
                <li key={index}>{list.id} | {list.name}</li>
            ))}
        </ul>
    </div>
  )
}

export default ApiEx;
